import topdhoni from "../../asstes/images/dhoni.png";
import topsais from "../../asstes/images/SaiSudarshan.png";
import topnitesh from "../../asstes/images/niteshkumar.png";


const TopPerformers =()=>{
    return (
        <div className="top-container">
        <h1 className="top-heading">Top Performs</h1>
        <button className="top-btn">seeMore</button>
        <div className="top-image">
            <img className="top-image1" src={topdhoni} alt="simple Images"/>
            <img className="top-image3" src={topsais} alt="simple Images"/>
            <img className="top-image2" src={topnitesh} alt="simple Images"/>
            
        </div>
        </div>
    )
}
export default TopPerformers;
